/*
FILENAME:     AppStack.js
PURPOSE:      Stack navigator for main app trivia game
AUTHOR:       Eric Phung
CREATED:      10/26/2020 02:28 PM
*/
import React from 'react';
import { Button, View, Text } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';

// screens
import WelcomeScreen from 'screens/WelcomeScreen';

function DetailsScreen({ navigation, route }) {
  // console.log('route.params: ', route.params);b
  const { cardId } = route.params;
  const view = (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Details Screen { cardId }</Text>
      <Button
        title="Go to next Details"
        onPress={() => navigation.push('Details', {
          cardId: cardId + 1,
        })}
      />
      {/*
        <Button title="Go to WelcomeScreen" onPress={() => navigation.navigate('Welcome')} />
        <Button title="Go back" onPress={() => navigation.goBack()} />
      */}
    </View>
  );
  return view;
}

const Stack = createStackNavigator();

function AppStack() {
  return (
    <Stack.Navigator initialRouteName="Welcome">
      <Stack.Screen name="Welcome" component={WelcomeScreen} />
      <Stack.Screen name="Details" component={DetailsScreen} />
    </Stack.Navigator>
  );
}

export default AppStack;
